import React from 'react';
import './profile.css';
import info from './info.png';
import bed from './bed.png';
import stat from './stat.png';
import friends from './friends.png';

const Profile = () => {
  return (
    <div className='profile'>
      <div className='profile-container'>
        <img className='profile-img' src='https://catherineasquithgallery.com/uploads/posts/2021-02/1612275687_118-p-kot-na-fioletovom-fone-141.jpg'/>
        <p className='name'>test@test.com</p>
        <div className='buttons-conteiner'>
            <div className='btn'>
                <button><img src={info}/>обо мне</button>
            </div>
            <div className='btn'>
                <button><img src={bed}/>мои сны</button>
            </div>
            <div className='btn'>
                <button><img src={friends}/>мои друзья</button>
            </div>
            <div className='btn'>
                <button><img src={stat}/>моя статистика</button>
            </div>
            <div className='btn'>
                <button>назад в ленту</button>
            </div>
        </div>
        <div className='profile-info'>

        </div>
      </div>
    </div>
  );
};

export default Profile;
